Chinese President Xi Jinping on Wednesday announced eight major steps China will take to support high-quality Belt and Road cooperation.
1⃣China will build a multidimensional Belt and Road connectivity network;
2⃣China will support an open world economy, with its total trade in goods and services expected to exceed 32 trillion U.S. dollars and 5 trillion U.S. dollars respectively in the 2024-2028 period;
3⃣China will carry out practical cooperation for the BRI. The country will promote both signature projects and "small yet smart" livelihood programs;
4⃣China will continue to promote green development.;
5⃣China will continue to advance scientific and technological innovation;
6⃣China will support people-to-people exchanges;
7⃣China will promote integrity-based Belt and Road cooperation;
8⃣China will strengthen the institutional building for international Belt and Road cooperation.

